import React from 'react';

export default function Sidebar() {
  return (
    <div className="main">
      <div className="sidebar">
        <ul>
          <li>1</li>
          <li>2</li>
          <li>3</li>
          <li>4</li>
        </ul>
      </div>
    </div>
  );
}
